import { useState } from "react";
const count = (cost,defvalue) => {
  return {
    value: cost < defvalue ? cost - cost + 520 : cost,
    message: cost > defvalue ? cost * 0.014:cost
  };
};
const useCounting = () => {
    const [state, setState] = useState({
      value: 0,
      message: ""
    });
    const onClickPlus = () => {
      setState(increase(state.value, 10));
    };
    const onClickMinus = () => {
      setState(decrease(state.value, 0));
    };
    return { onClickPlus, onClickMinus, state };
  };
  

export default useCounting;
